import React, { useState, useEffect } from 'react';
import axios from 'axios';
import employeeService from '../services/employee.service';

function ParentDataDisplay() {
  const [parentData, setParentData] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData =  () => {
    employeeService.viewAllParent()
    .then((response)=>{

        console.log(response.data) 
        setParentData(response.data);
        console.log(parentData);

   })
   .catch((error) => {
       console.log('Something went wrong', error);
     });
  };

  return (
    <div>
      <h1>Parent Data</h1>
      {parentData.map((parent) => (
        <div key={parent.parentId} className="parent-card">
          <div><strong>Email:</strong> {parent.email}</div>
          <div><strong>Date of Birth:</strong> {parent.dob}</div>
          <div><strong>Gender:</strong> {parent.gender}</div>
          <div><strong>Address:</strong> {parent.address}</div>
          {/* Add more <div> elements for other fields */}
        </div>
      ))}
    </div>
  );
}

export default ParentDataDisplay;
